export function apiPoint(x) {
  fetch("http://183.88.219.85:7078/appoint/point.php", {
    method: "POST",
    body: JSON.stringify({
      a: x
    })
  })
    .then(res => res.json())
    .then(res => {
      // console.log(res)
      var a = res
    })
  return a
}
